package model;

public class Formato01 {
	private int id;
	private String formato;
	public Formato01() {
		// TODO Auto-generated constructor stub
	}
	
	public Formato01(int id, String formato) {
		super();
		this.id = id;
		this.formato = formato;
	}

	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getFormato() {
		return formato;
	}
	public void setFormato(String formato) {
		this.formato = formato;
	}
	

}
